import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header className="bg-blue-600 text-white py-4">
      <div className="max-w-screen-xl mx-auto flex justify-between items-center">
        <h1 className="text-2xl font-bold">MobileCare</h1>
        <nav className="flex space-x-4">
          <Link to="/mobilecare/dashboard" className="hover:text-blue-300">Dashboard</Link>
          <Link to="/mobilecare/clients" className="hover:text-blue-300">Clients</Link>
          <Link to="/mobilecare/nurses" className="hover:text-blue-300">Nurses</Link>
          <Link to="/mobilecare/reports" className="hover:text-blue-300">Reports</Link>
          <Link to="/mobilecare/messages" className="hover:text-blue-300">Messages</Link>
        </nav>
      </div>
    </header>
  );
};

export default Header;
